import React, { useState, useEffect, useMemo } from 'react';
import RouteTable from './RouteTable';
import { Route } from '../../../core/domain/Route';
import { RouteService } from '../../../core/application/RouteService';
import { ComplianceService } from '../../../core/application/ComplianceService';
import { TransactionService } from '../../../core/application/TransactionService';
import { AxiosApiClient } from '../../infrastructure/api/AxiosApiClient';

const Dashboard: React.FC = () => {
  // 1. Initialize API Client and Services using useMemo
  // This ensures they are created only once and adheres to the Rules of Hooks.
  const apiClient = useMemo(() => new AxiosApiClient(), []);
  const routeService = useMemo(() => new RouteService(apiClient), [apiClient]);
  const complianceService = useMemo(() => new ComplianceService(apiClient), [apiClient]);
  const transactionService = useMemo(() => new TransactionService(apiClient, apiClient), [apiClient]);

  // 2. State Hooks (Starts here, around line 16)
  const [routes, setRoutes] = useState<Route[]>([]);
  const [cb, setCb] = useState<number | null>(null);
  const [selectedRouteId, setSelectedRouteId] = useState<string>('');
  const [formData, setFormData] = useState({
    vesselId: '',
    startPort: '',
    endPort: '',
    fuelUsed: '',
    distance: '',
    bankingVesselId: '',
    amount: '',
    type: 'credit' as 'credit' | 'debit',
    poolingFrom: '',
    poolingTo: '',
    cbAmount: '',
  });

  // 3. Effect Hooks
  useEffect(() => {
    loadRoutes();
  }, [routeService]); // Dependency added for completeness, though apiClient is memoized

  // 4. Handlers and Logic
  const loadRoutes = async () => {
    try {
      // Corresponds to routeService.getAllRoutes() -> RouteApiPort.getAll()
      const data = await routeService.getAllRoutes(); 
      setRoutes(data);
    } catch (error) {
      console.error('Failed to load routes:', error);
    }
  };

  const handleCreateRoute = async () => {
    try {
      // Corresponds to routeService.createRoute() -> RouteApiPort.create()
      const route = await routeService.createRoute({
        vesselId: formData.vesselId,
        startPort: formData.startPort,
        endPort: formData.endPort,
        fuelUsed: parseFloat(formData.fuelUsed),
        distance: parseFloat(formData.distance),
      });
      setRoutes([...routes, route]);
      // Clear fields
      setFormData(prev => ({ ...prev, vesselId: '', startPort: '', endPort: '', fuelUsed: '', distance: '' }));
    } catch (error) {
      console.error('Failed to create route:', error);
    }
  };

  const handleDeleteRoute = async (id: string) => {
    try {
      // Corresponds to routeService.deleteRoute() -> RouteApiPort.delete()
      await routeService.deleteRoute(id); 
      loadRoutes();
    } catch (error) {
      console.error('Failed to delete route:', error);
    }
  };


  const handleCalculateCB = async () => {
    if (selectedRouteId) {
      try {
        // Corresponds to complianceService.calculateCompliance() -> ComplianceApiPort.calculate()
        const calculatedCb = await complianceService.calculateCompliance(selectedRouteId); 
        setCb(calculatedCb);
      } catch (error) {
        console.error('Failed to calculate CB:', error);
      }
    }
  };

  const handleProcessTransaction = async () => {
    try {
      // Corresponds to transactionService.processTransaction() -> BankingApiPort.createTransaction()
      await transactionService.processTransaction(
        formData.bankingVesselId,
        parseFloat(formData.amount),
        formData.type
      );
      alert('Transaction processed successfully!');
      // Clear banking fields
      setFormData(prev => ({ ...prev, bankingVesselId: '', amount: '' }));
    } catch (error) {
      console.error('Failed to process transaction:', error);
    }
  };

  const handleCreatePooling = async () => {
    try {
      // Corresponds to transactionService.createPooling() -> PoolingApiPort.create()
      await transactionService.createPooling(
        formData.poolingFrom,
        formData.poolingTo,
        parseFloat(formData.cbAmount)
      );
      alert('Pooling created successfully!');
      // Clear pooling fields
      setFormData(prev => ({ ...prev, poolingFrom: '', poolingTo: '', cbAmount: '' }));
    } catch (error) {
      console.error('Failed to create pooling:', error);
    }
  };

  // 5. JSX Render
  return (
    <div className="p-6 max-w-4xl mx-auto">
      <h1 className="text-2xl font-bold mb-4">FuelEU Maritime Dashboard</h1>

      {/* CB Meter */}
      <div className="mb-6 border p-4 rounded shadow">
        <h2 className="text-lg font-semibold mb-2">Compliance Balance</h2>
        <div className="w-full bg-gray-200 rounded-full h-4">
          <div
            className={`h-4 rounded-full ${cb && cb > 0 ? 'bg-green-500' : 'bg-red-500'}`}
            style={{ width: `${cb !== null ? Math.min(100, Math.max(0, cb * 100)) : 0}%` }}
          ></div>
        </div>
        <p className="mt-2 text-sm">
          **Current CB:** {cb !== null ? `${(cb * 100).toFixed(1)}%` : 'Select a route to calculate'}
        </p>
        <select
          value={selectedRouteId}
          onChange={(e) => setSelectedRouteId(e.target.value)}
          className="mt-2 p-2 border rounded"
        >
          <option value="">Select Route</option>
          {routes.map((route) => (
            <option key={route.id} value={route.id}>
              {route.startPort} to {route.endPort} ({route.vesselId})
            </option>
          ))}
        </select>
        <button onClick={handleCalculateCB} className="ml-2 px-4 py-2 bg-blue-500 text-white rounded hover:bg-blue-600 transition">
          Calculate CB
        </button>
      </div>

      {/* Routes Table */}
      <RouteTable routes={routes} onDelete={handleDeleteRoute} />

      {/* Create Route Form */}
      <div className="mt-6 p-4 border rounded shadow">
        <h2 className="text-lg font-semibold mb-2">Create Route</h2>
        <input
          type="text"
          placeholder="Vessel ID"
          value={formData.vesselId}
          onChange={(e) => setFormData({ ...formData, vesselId: e.target.value })}
          className="p-2 border rounded mr-2 mb-2 w-full sm:w-auto"
        />
        <input
          type="text"
          placeholder="Start Port"
          value={formData.startPort}
          onChange={(e) => setFormData({ ...formData, startPort: e.target.value })}
          className="p-2 border rounded mr-2 mb-2 w-full sm:w-auto"
        />
        <input
          type="text"
          placeholder="End Port"
          value={formData.endPort}
          onChange={(e) => setFormData({ ...formData, endPort: e.target.value })}
          className="p-2 border rounded mr-2 mb-2 w-full sm:w-auto"
        />
        <input
          type="number"
          placeholder="Fuel Used"
          value={formData.fuelUsed}
          onChange={(e) => setFormData({ ...formData, fuelUsed: e.target.value })}
          className="p-2 border rounded mr-2 mb-2 w-full sm:w-auto"
        />
        <input
          type="number"
          placeholder="Distance"
          value={formData.distance}
          onChange={(e) => setFormData({ ...formData, distance: e.target.value })}
          className="p-2 border rounded mr-2 mb-2 w-full sm:w-auto"
        />
        <button onClick={handleCreateRoute} className="px-4 py-2 bg-green-500 text-white rounded hover:bg-green-600 transition">
          Create Route
        </button>
      </div>

      {/* Banking Form */}
      <div className="mt-6 p-4 border rounded shadow">
        <h2 className="text-lg font-semibold mb-2">Process Banking Transaction</h2>
        <input
          type="text"
          placeholder="Vessel ID"
          value={formData.bankingVesselId}
          onChange={(e) => setFormData({ ...formData, bankingVesselId: e.target.value })}
          className="p-2 border rounded mr-2 mb-2 w-full sm:w-auto"
        />
        <input
          type="number"
          placeholder="Amount"
          value={formData.amount}
          onChange={(e) => setFormData({ ...formData, amount: e.target.value })}
          className="p-2 border rounded mr-2 mb-2 w-full sm:w-auto"
        />
        <select
          value={formData.type}
          onChange={(e) => setFormData({ ...formData, type: e.target.value as 'credit' | 'debit' })}
          className="p-2 border rounded mr-2 mb-2 w-full sm:w-auto"
        >
          <option value="credit">Credit</option>
          <option value="debit">Debit</option>
        </select>
        <button onClick={handleProcessTransaction} className="px-4 py-2 bg-purple-500 text-white rounded hover:bg-purple-600 transition">
          Process Transaction
        </button>
      </div>

      {/* Pooling Form */}
      <div className="mt-6 p-4 border rounded shadow">
        <h2 className="text-lg font-semibold mb-2">Create Pooling</h2>
        <input
          type="text"
          placeholder="From Vessel ID"
          value={formData.poolingFrom}
          onChange={(e) => setFormData({ ...formData, poolingFrom: e.target.value })}
          className="p-2 border rounded mr-2 mb-2 w-full sm:w-auto"
        />
        <input
          type="text"
          placeholder="To Vessel ID"
          value={formData.poolingTo}
          onChange={(e) => setFormData({ ...formData, poolingTo: e.target.value })}
          className="p-2 border rounded mr-2 mb-2 w-full sm:w-auto"
        />
        <input
          type="number"
          placeholder="CB Amount"
          value={formData.cbAmount}
          onChange={(e) => setFormData({ ...formData, cbAmount: e.target.value })}
          className="p-2 border rounded mr-2 mb-2 w-full sm:w-auto"
        />
        <button onClick={handleCreatePooling} className="px-4 py-2 bg-orange-500 text-white rounded hover:bg-orange-600 transition">
          Create Pooling
        </button>
      </div>
    </div>
  );
};

export default Dashboard;
